(8, 'Endomarketing to Service Desk', 'Aimed at directors, managers, coordinators and supervisors of technology that has relationship with the users or any aspects of the business, the workshop Endomarketing for Service Desk is intended to present the benefits of communication in relation to the results obtained by IT to effectively by', '', '4', 'HR Essentials', 50.00, 2, NULL, NULL, 'EN', , 1);
