INSERT INTO `course_lessons` (`lesson_id`, `lesson_title`, `lesson_text`, `lesson_video`, `lesson_length`, `course_id`, `course_module`, `lesson_order`, `lesson_released`) VALUES
(1, 'Lesson 1', '<div class=\"divBorderedGrid\">\n<h3>What is Scriptcase?</h3>\n<p class=\"text-grid\">It\'s the best and most efficient web development tool focused on SQL databases (MySQL, Access, Oracle, SQL Server...). A powerful PHP generator to develop systems in a safe and fast way, increasing productivity and reducing costs.</p>\n</div>\n<div>\n<h3>What does it do?</h3>\n<p class=\"text-grid\">It helps you to develop web applications in a fast and intuitive way, such as: management reports (Business Intelligence - BI), customizable HTML5 charts, registration forms, users authentication, menus, dashboards and others apps.</p>\n</div>\n<div>\n<h3>How does it work?</h3>\n<p class=\"text-grid\">Can be installed in a local network or on the Internet to be accessed by any browser. It allows that multiple developers work on the same project connected to an SQL database. The generated applications are independent from Scriptcase.</p>\n</div>', 'https://player.vimeo.com/video/151658834', 15, 2, 1, 0, 1),
(2, 'Lesson 2', '<p><span>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque volutpat porta ex et aliquam. Fusce ornare diam sed enim maximus, ac pretium tortor tempus. Fusce dignissim tellus velit, non euismod mi tempor nec. Duis molestie mi risus, vel pharetra purus elementum ac. In in purus eu orci fermentum posuere. Nunc vitae faucibus urna. Nullam at interdum dolor.</span></p>', 'https://www.youtube.com/embed/63DpNWWfWsE', 45, 2, 1, 0, 1),
(3, 'Lesson 3', '<p><span>Mauris mattis quis felis sed venenatis. Maecenas eget lacus hendrerit, tincidunt eros in, auctor elit. Aliquam eleifend volutpat justo. Curabitur hendrerit nulla mi, interdum sodales purus vestibulum at. Proin sem nunc, condimentum nec diam in, fringilla hendrerit arcu. Vestibulum tincidunt, metus ac faucibus placerat, nisi metus pretium mauris, non feugiat orci justo vitae arcu. Morbi enim sapien, facilisis cursus pharetra sit amet, varius eu ipsum. Suspendisse eleifend massa vel neque rutrum finibus. Ut ullamcorper, lorem nec fermentum viverra, arcu erat interdum nunc, et facilisis lectus ex at dolor. Aliquam erat volutpat.</span></p>', '<iframe width=\"800\" height=\"600\" src=\"https://www.youtube.com/embed/B_6qDlJaFj4?list=PLDMYt0EmYW5xjM9QlY6CaPJJtO89BjYDy\" frameborder=\"0\" allowfullscreen></iframe>', 120, 2, 1, 0, 1),
(4, 'Lesson 4', '<p><span>Cras feugiat mauris nunc, ac hendrerit tellus molestie vel. Vestibulum dictum auctor orci, sed maximus tellus rutrum a. Donec non feugiat nunc. Phasellus aliquam leo ac augue varius varius. Proin bibendum lorem at lorem maximus, eu porta tortor volutpat. In vel tortor nisi. Duis bibendum tincidunt orci at ornare. Praesent id lectus pharetra, gravida nisi sed, rutrum est. Nam vehicula consequat neque ut molestie. Praesent eu ligula erat.</span></p>', '<iframe width=\"800\" height=\"600\" src=\"https://www.youtube.com/embed/B_6qDlJaFj4?list=PLDMYt0EmYW5xjM9QlY6CaPJJtO89BjYDy\" frameborder=\"0\" allowfullscreen></iframe>', 25, 2, 2, 0, 1),
(5, 'Lesson 5', '<p><span>Quisque ornare et libero quis pretium. Curabitur orci augue, molestie sit amet rhoncus et, posuere vitae risus. Quisque laoreet erat ac rhoncus ullamcorper. Integer venenatis felis rutrum accumsan aliquam. Phasellus ut imperdiet orci. Phasellus nec nulla varius, commodo lacus eget, tempus urna. Suspendisse suscipit mauris a pharetra auctor. Etiam ac dictum nulla. Suspendisse feugiat ornare mi, sed pharetra eros maximus vestibulum.</span></p>', 'https://www.youtube.com/embed/63DpNWWfWsE', 30, 2, 3, 0, 1),
(6, 'Class 01: Introduction', '<div>In this class we will show a brief introduction about what is Scriptcase, what it does, how it works and its advantages. What the tool needs to run and the difference between development and production environment. </div>\n<div> </div>\n<div>After the introduction we will give an overview about the Scritpcase\'s environment and we will also create our project.</div>\n<div> </div>\n<div>We will create a form and discuss it\'s basics features. In the end we will showcase the data dictionary feature and will give the introduction of the menu application.</div>\n<p> </p>', 'https://www.youtube.com/embed/63DpNWWfWsE', 0, 11, 1, 0, 1),
(7, 'Class 02: Grid resources and Master-details Form', '<p><span>In this class we will create and discuss the first grid application, learn how link works and use the master detail feature to make two forms working together at the same screen.</span></p>', 'https://player.vimeo.com/video/151658834', 0, 11, 1, 1, 1),
(8, 'Class 03: Admin Applications', '<div>In this class we will create the admin side applications, this applications include:</div>\n<div>- Admin\'s appointments report</div>\n<div>- Form to create, schedule and calculate the appointment services cost automatically.</div>', '<iframe src=\"https://player.vimeo.com/video/151658834\" width=\"500\" height=\"281\" frameborder=\"0\"  webkitallowfullscreen=\"true\" mozallowfullscreen=\"true\" allowfullscreen=\"true\"></iframe>', 0, 11, 1, 2, 1),
(9, 'Q & A 1', '', 'https://player.vimeo.com/video/151658834', 2, 11, 1, 4, 1),
(10, 'Class 04: Customer Applications', '<p><span>The customer will select in a list what services he needs to schedule, the request will be generated by the RUN button and redirect the customer to a form to select the date and time of the appointment, after he selects, he will be redirected to the report with all his appointments.  </span></p>', 'https://player.vimeo.com/video/151658834', 0, 11, 1, 3, 1),
(11, 'Class 05: Staff Applications', '<p><span>The staff will have two options to follow up his own appointments, using a report application with filters and group by or a calendar showing his appointments. To proceed with an appointment the Staff is able to check a google maps app with the customer’s address.  </span></p>', 'https://player.vimeo.com/video/151658834', 0, 11, 2, 0, 1),
(12, 'Class 06: Buttons and Links', '<div>In this class we will create a user defined report with a custom HTML template in order to show a billing summary for the customer.</div>\n<div> </div>\n<div>We are also creating some apps that will complete the system usage in general, apps to: Show the appointments history, details and rate.</div>\n<div> </div>\n<div>We can\'t forget about a report that will be used by the admin, staff and customer to perform all types of actions on a specific appointment.</div>', 'https://player.vimeo.com/video/151658834', 2, 11, 2, 1, 1),
(13, 'Class 07: Tab, Dashboard and Calendar', '<p><span>On this class we are going to create a set of applications used to exhibit other applications, we are also going to create a dashboard to show 4 apps at the same time, this app will be used as home to the admin.</span></p>', 'https://player.vimeo.com/video/151658834', 2, 11, 2, 2, 1),
(14, 'Q & A 2', '', 'https://player.vimeo.com/video/151658834', 2, 11, 3, 1, 1),
(15, 'Class 8: Calendar and Security', '<div>We will create a calendar application using our own coding in a blank application using the ‘my calendar’ API from Scriptcase and we will use the form_appointments to helps us to maintain the data in the application </div>\n<div> </div>\n<div>The Scriptcase’s security module Will handle all the access control to your system, not only the access but what apps and what actions the end user may do with the app. </div>', 'https://player.vimeo.com/video/151658834', 2, 11, 3, 0, 1),
(16, 'Extra Class - Login Screen', '', 'https://player.vimeo.com/video/151658834', 0, 11, 3, 10, 0),
(17, 'ABC', '<p>Ut eu nulla vel eros porttitor imperdiet. Mauris porta lacus nulla, ut molestie neque cursus vel. Fusce pulvinar sollicitudin tortor, vitae faucibus leo dignissim ac. Sed efficitur, nisi in venenatis iaculis, velit arcu posuere ante, a pellentesque risus nisl non tortor. Quisque in tincidunt augue. Praesent lacinia felis id nibh tincidunt condimentum. Morbi iaculis dapibus diam, id fringilla leo vulputate at. Sed laoreet tempus malesuada.</p>', 'https://www.youtube.com/embed/63DpNWWfWsE', 0, 3, 1, 0, 1),
(18, 'Lesson 6', '<p><span>Quisque enim ante, euismod vel quam eget, rhoncus fermentum tellus. Nullam interdum, nisi eget tincidunt dictum, erat eros pretium nunc, sed posuere ipsum purus eu tortor. Duis elementum justo ut magna dapibus, ac commodo metus volutpat. Quisque at lorem urna. Proin fermentum condimentum quam, sed posuere dui feugiat a. Aenean mollis placerat nunc eu porttitor. Nunc iaculis enim sem. Nam pellentesque suscipit ullamcorper. Quisque semper quis ex eu fringilla. Nulla vehicula lobortis massa, ac porttitor nulla mattis sit amet. Fusce malesuada nisl quis tortor fermentum, eget tincidunt justo semper. Phasellus in lorem vestibulum, aliquet arcu eget, mattis felis. Sed justo nunc, finibus nec efficitur quis, consectetur ut ante. Aliquam eu nisl libero. Aliquam erat volutpat. Integer vel leo sed magna hendrerit tempor eleifend sed diam.</span></p>', 'https://www.youtube.com/embed/63DpNWWfWsE', 0, 2, 1, 1, 0),
(19, 'Lesson 7', '<p><span>Ut eu nulla vel eros porttitor imperdiet. Mauris porta lacus nulla, ut molestie neque cursus vel. Fusce pulvinar sollicitudin tortor, vitae faucibus leo dignissim ac. Sed efficitur, nisi in venenatis iaculis, velit arcu posuere ante, a pellentesque risus nisl non tortor. Quisque in tincidunt augue. Praesent lacinia felis id nibh tincidunt condimentum. Morbi iaculis dapibus diam, id fringilla leo vulputate at. Sed laoreet tempus malesuada.</span></p>', 'https://www.youtube.com/embed/63DpNWWfWsE', 0, 2, 2, 2, 0),
(20, 'Lesson 8', '<p><span>In consectetur purus eget nulla faucibus ultricies. Integer volutpat mi nec blandit iaculis. Donec pretium, purus quis suscipit laoreet, velit libero pharetra elit, ut porta sem odio at odio. Curabitur pretium, nibh id dapibus aliquet, nisl urna placerat nulla, vitae lobortis mi magna sit amet quam. Maecenas at dui quis mauris malesuada vulputate. Pellentesque ut ipsum risus. Curabitur quis tristique purus. Proin vehicula dictum erat sit amet porta. Ut sit amet hendrerit sapien.</span></p>', 'https://www.youtube.com/embed/63DpNWWfWsE', 0, 2, 3, 3, 0),
(21, 'Lesson 9', '<p><span>Nam lectus elit, maximus id enim sit amet, fringilla pulvinar risus. Sed pellentesque vel augue vitae lacinia. Fusce non porttitor enim. Mauris eget mollis lacus. Sed mollis tortor ac arcu fringilla, in pulvinar diam venenatis. Fusce et arcu velit. Phasellus quis consectetur erat, pulvinar venenatis metus. Suspendisse sodales justo non libero sollicitudin dapibus. Fusce sit amet libero in diam hendrerit cursus. Donec consectetur facilisis varius. Nullam urna quam, iaculis eu placerat ac, porttitor dictum risus. Vivamus bibendum elementum massa, sit amet eleifend odio congue eu. Praesent accumsan sapien eget semper laoreet. Vestibulum eu metus nunc. Nullam sit amet sodales odio, quis porttitor diam. Nunc semper ac tortor quis lacinia.</span></p>', '<iframe src=\"https://player.vimeo.com/video/151658834\" width=\"500\" height=\"281\" frameborder=\"0\"  webkitallowfullscreen=\"true\" mozallowfullscreen=\"true\" allowfullscreen=\"true\"></iframe>', 0, 2, 4, 4, 0),
(22, 'Lesson 10', '<p><span>Phasellus euismod nunc sed tincidunt pharetra. Aenean ut venenatis dolor, quis faucibus elit. Fusce sit amet auctor mauris. Donec a rhoncus neque, sit amet viverra leo. Vestibulum at turpis placerat, tincidunt nisl nec, tincidunt est. Nam pretium eros et justo ornare, rutrum bibendum massa finibus. Donec non turpis vestibulum, facilisis tellus vel, dictum nisl. Donec vel leo auctor, dictum magna in, dictum leo. Cras quis lorem sit amet arcu porta sollicitudin et non neque. Vestibulum vehicula sapien risus, id varius mauris cursus sed. Morbi eu velit consequat purus fringilla sodales. Phasellus sit amet nisl dictum, euismod tellus at, convallis massa. In eget vestibulum nibh. Aenean volutpat est eget interdum lobortis. Duis vitae porta sem.</span></p>', '<iframe src=\"https://player.vimeo.com/video/151658834\" width=\"500\" height=\"281\" frameborder=\"0\"  webkitallowfullscreen=\"true\" mozallowfullscreen=\"true\" allowfullscreen=\"true\"></iframe>', 0, 2, 5, 5, 0);

